class Solution:
    def shortestPalindrome(self, s):
        """
        :type s: str
        :rtype: str
        """
        length = len(s)
        if length==0:
            return ""

        dp = [[0]*length for i in range(length)]
        for l in range(length):
            for i in range(length-l):
                j = i+l
                if i==j:
                    dp[i][j]=1
                else:
                    if s[i]==s[j]:
                        if j-i==1:
                            dp[i][j] = 2
                        elif dp[i+1][j-1]>0:
                            dp[i][j] = dp[i+1][j-1]+2

        start,tmpstr = max(dp[0][:]),[]
        for i in list(range(start,length)):
            tmpstr.insert(0,s[i])

        ans = "".join(tmpstr)+s
        return ans

line=""
s = Solution()
ans = s.shortestPalindrome(line)
print(ans)